allow-lan: true
bind-address: "*"
ipv6: true
log-level: info
find-process-mode: always
enable-process: true
unified-delay: false
keep-alive-interval: 30
tcp-concurrent: false
geodata-mode: true
geodata-loader: memconservative
external-controller: 127.0.0.1:9090
external-ui: ui
external-ui-url: "https://github.com/MetaCubeX/metacubexd/archive/refs/heads/gh-pages.zip"
global-client-fingerprint: chrome
geo-auto-update: true
geo-update-interval: 24
global-ua: clash.meta
profile:
  store-selected: true
  store-fake-ip: true
experimental:
  quic-go-disable-gso: false
  quic-go-disable-ecn: false
sniffer:
  enable: true
  sniff:
    HTTP:
      ports: [80, 8080-8880]
      override-destination: true
    TLS:
      ports: [443, 8443]
    QUIC:
      ports: [443, 8443]
  skip-domain:
    - "Mijia Cloud"
tun:
  enable: true
  stack: mixed
  dns-hijack:
    - 'any:53'
  auto-route: true
  auto-detect-interface: true

geox-url:
  geoip: "https://github.com/chocolate4u/Iran-v2ray-rules/releases/latest/download/geoip.dat"
  geosite: "https://github.com/chocolate4u/Iran-v2ray-rules/releases/latest/download/geosite.dat"
  mmdb: "https://github.com/chocolate4u/Iran-clash-rules/releases/latest/download/geoip.metadb"
dns:
  enabled: true
  listen: 0.0.0.0:1053
  ipv6: true
  use-hosts: true
  remote-dns-resolve: true
  default-nameserver:
    - udp://8.8.8.8:853
    - https://120.53.53.53/dns-query
    - tcp://1.1.1.1:853
    - tcp://8.8.8.8:853
    - tls://1.1.1.1:853
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  fake-ip-filter:
    - '*.lan'
  nameserver:
    - tls://223.5.5.5:853
    - https://120.53.53.53/dns-query
    - tls://120.53.53.853
  remote-nameserver:
    - https://8.8.8.8/dns-query
    - tcp://8.8.8.8   
  nameserver-policy:
    "geosite:.ir,private": 
      - https://223.5.5.5/dns-query
      - https://120.53.53.53/dns-query
